<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>MyEagleID</title>
  <style>
    body {
      margin: 0;
      font-family: Arial, sans-serif;
      background-color: #eeeeee;
      display: flex;
      justify-content: center;
      align-items: center;
      min-height: 100vh;
    }
    .card {
      background-color: white;
      border-radius: 12px;
      box-shadow: 0 0 15px rgba(0, 0, 0, 0.2);
      width: 400px;
      padding: 30px 20px;
      text-align: center;
    }
    .card h2 {
      font-family: Arial, sans-serif;
      font-style: italic;
      color: #001641;
      font-size: 22px;
      margin: 0 0 20px 0;
    }
    .card img.photo {
      width: 200px;
      border-radius: 10px;
    }
    .card .name {
      font-weight: bold;
      font-size: 18px;
      color: #002147;
      margin-top: 20px;
    }
    .card .id-number {
      font-size: 18px;
      color: #002147;
      margin-bottom: 20px;
    }
    .card img.barcode {
      margin-top: 10px;
      width: 250px;
    }
    .card .note {
      font-size: 12px;
      color: #555;
      margin-top: 20px;
      padding: 0 10px;
    }
  </style>
</head>
